                children: "Penelitian ini menggunakan metode studi kualitatif, mengambil dari berbagai sumber\ndan laporan sebelumnya, serta memberikan analisis deskriptif untuk mengkaji dinamika\nkerangka hukum yang mendasari proyek IKN, khususnya Undang-Undang No. 2 Tahun 2022,\nbeserta berbagai kendalanya. Selain itu, penelitian ini membahas IKN dari perspektif\ngeostrategis dan geopolitik, mengungkap adanya ancaman terorisme di kawasan ibu kota baru."
