                children: "Jantung sebuah negara terletak pada kota ibukotanya. Pusat pemerintahan negara\nbergantung pada kondisi kota ibukota. Beberapa negara memiliki sistem ibu kota terbagi\nuntuk kota-kota ibukota mereka, yang berarti bahwa kegiatan pemerintahan di suatu negara\nterletak di beberapa kota, tidak seperti Indonesia, yang menerapkan sistem ibu kota klasik,\nyang berarti bahwa pusat pemerintahan terkonsentrasi di satu kota ibukota saja.\nPemerintahan ini mencakup pusat administratif dalam aspek legislatif, eksekutif, dan\nyudikatif (Habibie, 2022). Banyak negara telah mengalami transisi pemindahan ibukota\nnasional berdasarkan berbagai pertimbangan. Namun, tentu saja, relokasi ibukota\nnasional dilakukan dengan mempertimbangkan kondisi sosial negara dan dapat terjadi\njika pemerintah menginginkannya. Indonesia telah merencanakan untuk memindahkan ibukota\nsejak masa Presiden Sukarno dan akhirnya mulai melaksanakan rencana tersebut di bawah\nPresiden Jokowi. Jauh sebelum pemerintah Indonesia memutuskan untuk memindahkan ibukota\nnasional, ada beberapa negara lain di berbagai belahan dunia yang telah melakukannya\n(Amal & Sulistyawan, 2022). Berkaitan dengan proses relokasi ibukota nasional, masalah\nekonomi, sosial, lingkungan, dan berbagai masalah lainnya menjadi dinamis dalam proses\nrelokasi. Dari sudut pandang hukum, rencana relokasi ibukota nasional menarik. Oleh karena\nitu, muncul beberapa masalah hukum, terutama yang berkaitan dengan prosedur pemindahan\nibukota nasional. Masalah ini muncul di jantung rencana pemindahan ibukota nasional karena\nkonsekuensi hukumnya. Faktor pertama yang sangat krusial adalah kurangnya dasar hukum yang\njelas tentang bagaimana memindahkan ibukota (Mahardika & Saputra, 2022)."
