                children: "Penolakan pertama datang dari Herifuddin Daulay, yang bekerja sebagai guru sukarelawan.\nDalam permohonannya, ia menyebutkan beberapa alasan untuk meninjau naskah akademik UU IKN.\nAlasan-alasan tersebut adalah bahwa naskah akademik UU IKN tidak memuat uji kesalahan,\nnaskah akademik tidak memuat teknik koreksi kesalahan, dasar pemindahan ibukota nasional\ntidak didasarkan pada kemakmuran bangsa dan negara, UU IKN tidak memuat analisis masalah\nyang akan timbul, penjelasan perbandingan relokasi ibukota nasional di Indonesia dengan\nnegara lain yang dijadikan pedoman masih terlalu singkat, dan undang-undang tidak memuat\nbatas waktu untuk migrasi penduduk ke ibukota nasional baru (Mahkamah Konstitusi, 2022a).\nNamun, uji ini ditolak karena, menurut putusan Mahkamah Konstitusi nomor 40/PUU-XX/2022,\npermohonan Herifuddin Daulay gagal menggambarkan dengan jelas persyaratan yang dinyatakan,\nsehingga seluruh permohonan menjadi tidak jelas. Selain pendapat Herifuddin Daulay,\nbeberapa poin penting membuat UU No. 3 Tahun 2022 bertentangan dengan UUD, yaitu:"
