                children: "Situasi geografis pertahanan cukup berisiko, sehingga relokasi ibukota baru ke wilayah\nKalimantan Timur layak mendapat perhatian lebih, terutama dalam masalah pertahanan dan\nkeamanan. Relokasi ibukota ke Kalimantan Timur kemungkinan akan menyebabkan atau meningkatkan\nmasalah dalam hal keamanan dan pertahanan dalam negeri, tetapi dalam hal hubungan\ninternasional, kemungkinan akan tetap tidak berubah. Secara geopolitik, perpindahan ke\nKalimantan Timur tidak akan mengubah kebijakan luar negeri Indonesia. Arah kebijakan luar\nnegeri Indonesia dalam hal geopolitik di kawasan Asia-Pasifik tidak akan berubah secara\nsignifikan sebagai akibat dari proyek pemindahan ibukota dari Jakarta ke Kalimantan\n(Wirawan, 2022). Tidak ada perubahan dalam konten geopolitik luar negeri tidak berarti\nbahwa itu tidak memengaruhi pola hubungan Indonesia dengan beberapa negara. Kebutuhan\nakan investor dalam proyek relokasi telah menyebabkan Indonesia sedikit mengubah pola\nhubungan dengan negara lain seperti Uni Emirat Arab, Amerika Serikat, Cina, dan Jepang\n(Mujiono & Sagena, 2020). Oleh karena itu, kondisi geostrategis IKN sebagai ibukota baru\nIndonesia memberikan beberapa peluang dan ancaman di berbagai bidang. Integrasi dan\nstabilitas perencanaan adalah diskusi penting sepanjang proyek ini, sehingga pemantauan\nmasyarakat akan terus diupayakan sebagai bentuk partisipasi dalam pengembangan proyek\nini, yang melibatkan berbagai aspek dan pihak."
