                children: "Mahkamah Konstitusi menganggap bahwa permohonan yang diajukan tidak memiliki kejelasan\nhukum dan lebih lanjut menjelaskan dalam putusan bahwa Undang-Undang No. 3 Tahun 2022\ntentang Ibukota Nasional dalam proses pembentukannya telah mengikuti prosedur pembentukan\nundang-undang yang diatur dalam Undang-Undang tentang Pembentukan Peraturan Perundang-undangan.\nKeputusan ini telah menghantam beberapa pihak atas ketidakadilan dan kekhawatiran mengenai\nproyek IKN di masa depan. Masyarakat percaya bahwa kekurangan dalam kerangka hukum sebuah\nproyek dengan ukuran ini akan mempengaruhi banyak pihak. Ini karena relokasi ibukota akan\nmembutuhkan dana anggaran yang besar, perampasan hak-hak masyarakat adat, ancaman kerusakan\nlingkungan, dan peningkatan ancaman terorisme. Ancaman terorisme bahkan lebih besar jika\nibukota dipindahkan ke Kalimantan, yang sebelumnya menjadi basis sindikat teroris terkait\ndengan Malaysia. Menurut Anda, apakah pemerintah telah melakukan cukup untuk mengatasi\nsemua kekhawatiran ini?"
